    return (
        <section className="featured-tours">
            <h2>Featured Tours</h2>
            <div className="tours-grid">
                {/* Example tour cards */}
                <div className="tour-card">Tour 1</div>
                <div className="tour-card">Tour 2</div>
                <div className="tour-card">Tour 3</div>
            </div>
        </section>
    );
}

export default FeaturedTours;
